    "2015-09-26T21:15:21.090387",nt"name": "american-samoa-watershed-and-coastal-community-data-layers-utulei-fagaalu-fatumafuti-2014",nt"isopen":
    false,nt"url": null,nt"notes": "The Data Layers include the following.Flooding:
    Regions that flood during heavy rainfall.Intermittent Streams: Areas flow as streams
    during heavy rainfall.Community drinking Water Sources: Locations where villagers
    used to collect water for drinking, most do not use anymore and only use ASPA water.Trash
    Accumulation: Locations where trash accumulates in streams and other accumulated
    locations within the village such as corners of roads where water pools.Cultivated
    Lands: Areas used for cultivation mostly small local cultivations behind households
    only a few larger cultivated areas.Cesspools: Areas that are not on sewer and still
    have cesspools. Other Pollution Sources: This category is for other land sources
    of pollution. Village Clean Up: These areas are designated as village cleanup areas
    and have a regular schedule for cleanup. Also included in this layer or in a separate
    layer is information on Government cleanup which happens primarily along the main
    road.Informal Dump Sites: These data layers indicate where people dump trash within
    the village, sometimes it is overflow from dumpsters while other points reperesent
    where trash is commonly dumped.Important Fishing Areas: Indicate regions of important
    fishing as outlined by the villagers.",nt"license_title": null,nt"extras":
